import React, { Fragment } from 'react';
import { render } from 'react-dom';

import Generation from './components/Generation';
import Dragon from './components/Dragon';

render(
    <div>
        <h2>DragonStack</h2>
        <Fragment>
            <Generation />
            <Dragon />
        </Fragment>
    </div>,
    document.getElementById('root')
);
